import { useEffect, useState} from "react"
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

const Students = ()=>{
const url = 'http://localhost:8080/v1/student'
const [students, setStudents] = useState([]);

const getDataStudents = async ()=> {
    const response = await fetch(url)
    const dataStudent = await response.json();
   setStudents(dataStudent.data);
   console.log(dataStudent.data);
}

useEffect(() =>{
    getDataStudents();
},[])

return (
    <div className="container">
        <div className="row">
        <h1>My Students</h1>
        {students.map((siswa)=>  {
            return (
                <div className="col-3">
                <CardStud id={siswa.stud_id} name={siswa.stud_name} age={siswa.stud_age} address={siswa.stud_address} phonenum={siswa.stud_phonenum} />
                </div>
            )
        })}
           

        </div>
       
    </div>
)
}

function CardStud(){
    return (
        <Card style={{ width: '18rem' }}>
          <Card.Body>
            <Card.Title>Card Title</Card.Title>
            <Card.Text>
              Some quick example text to build on the card title and make up the
              bulk of the card's content.
            </Card.Text>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
        </Card>
      );
}

export default Students;
